// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract RegistroInvestigaciones {

	// Estructura de datos  que contiene la informacion relativa a un registro de una investigacin
        struct Investigacion {
        	string nombre_Investigador;
        	string apellido1_Investigador;
        	string apellido2_Investigador;
		string timestamp;
        	string hash_documento;
        	uint identificador_institucion;
		uint identificador_documento;
        }

	// Estructura de datos  que contiene la informacion relativa a una institucion
	struct Institucion {
		string nombre_institucion;
		uint identificador_institucion;
		uint total_investigaciones_institucion;
		mapping(uint => Investigacion) listaInvestigaciones_id;
        	mapping(string => Investigacion) listaInvestigaciones_hash;
	}

	// Un listado de las instituciones registradas en la blockchain
	mapping(uint => Institucion) listaInstituciones_id;

        //Listas globales que identifican todas las investigaciones
        mapping(uint => Investigacion) listaInvestigaciones_id_global;
        mapping(string => Investigacion) listaInvestigaciones_hash_global;

        // Contador del total de cursos disponibles
        uint totalInvestigaciones;

        //  Direccin ETH del administrador (se inicializa en el constructor y se correspondera con la direccin ETH que despliegue el contrato en la red)
        address administrador;

        // Prerequisito para algunas funciones que requieren que sean ejecutadas solo por el administrador
        modifier onlyAdmin {
          require(msg.sender == administrador,
            "Operacion solo permitida para el administrador del contrato."
          );
          _;
        }

        // Prerequisito para algunas funciones que requieren que sean ejecutadas solo por aquellas direcciones ETH autorizadas por el administrador
        modifier onlyAuthorized(address addr) {
          require(addr == 0x00,
            "Usuario no autorizado para realizar dicha operacion."
          );
          _;
        }


        /**
        * Constructor del Smart Contract
        *
        * Inicializa la variable 'totalInvestigaciones' a cero
        */
	constructor() public {
		administrador = msg.sender;
        	totalInvestigaciones = 0;
        }


        /**
        * Recibe como parametro los datos asociados a una investigacion y procede con su registro.
        *
        * @param param_nombre_institucion --> Nombre de la institucion.
        * @param param_identificador_institucion --> Identificador de la institucion.
        * @param param_nombre_Investigador --> Nombre del investigador.
        * @param param_apellido1_Investigador --> Primer apellido del investigador.
	* @param param_apellido2_Investigador --> Segundo apellido del investigador.
	* @param param_timestamp --> Marca de tiempo del momento en el que se llev a cabo el cifrado del fichero.
	* @param param_hash_documento --> Hash del fichero cifrado.
 institucion a la que pertenece la investigacion.
        */
        function registrarInvestigacion(string memory param_nombre_institucion, uint param_identificador_institucion, string memory param_nombre_Investigador, string memory param_apellido1_Investigador, string memory param_apellido2_Investigador, string memory param_timestamp, string memory param_hash_documento) public {

		/*
		*	Registro que referencia a la institucion.
		*/
		listaInstituciones_id[param_identificador_institucion].nombre_institucion = param_nombre_institucion;
		listaInstituciones_id[param_identificador_institucion].identificador_institucion = param_identificador_institucion;
		uint indexInvestigacionInstitucion = listaInstituciones_id[param_identificador_institucion].total_investigaciones_institucion;

		/*
		*	Registro en la lista que referencia las investigaciones en base a la institucion y su ID
		*/
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[indexInvestigacionInstitucion].nombre_Investigador = param_nombre_Investigador;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[indexInvestigacionInstitucion].apellido1_Investigador = param_apellido1_Investigador;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[indexInvestigacionInstitucion].apellido2_Investigador = param_apellido2_Investigador;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[indexInvestigacionInstitucion].timestamp = param_timestamp;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[indexInvestigacionInstitucion].hash_documento = param_hash_documento;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[indexInvestigacionInstitucion].identificador_institucion = param_identificador_institucion;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[indexInvestigacionInstitucion].identificador_documento = totalInvestigaciones;

		/*
		*	Registro en la lista que referencia las investigaciones en base a la institucion y el hash del documento
		*/
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_hash[param_hash_documento].nombre_Investigador = param_nombre_Investigador;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_hash[param_hash_documento].apellido1_Investigador = param_apellido1_Investigador;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_hash[param_hash_documento].apellido2_Investigador = param_apellido2_Investigador;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_hash[param_hash_documento].timestamp = param_timestamp;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_hash[param_hash_documento].hash_documento = param_hash_documento;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_hash[param_hash_documento].identificador_institucion = param_identificador_institucion;
		listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_hash[param_hash_documento].identificador_documento = totalInvestigaciones;

		listaInstituciones_id[param_identificador_institucion].total_investigaciones_institucion++;

		/*
		*	Registro en la lista de investigaciones globales en base al ID de la misma.
		*/
		listaInvestigaciones_id_global[totalInvestigaciones].nombre_Investigador = param_nombre_Investigador;
		listaInvestigaciones_id_global[totalInvestigaciones].apellido1_Investigador = param_apellido1_Investigador;
		listaInvestigaciones_id_global[totalInvestigaciones].apellido2_Investigador = param_apellido2_Investigador;
		listaInvestigaciones_id_global[totalInvestigaciones].timestamp = param_timestamp;
		listaInvestigaciones_id_global[totalInvestigaciones].hash_documento = param_hash_documento;
		listaInvestigaciones_id_global[totalInvestigaciones].identificador_institucion = param_identificador_institucion;
		listaInvestigaciones_id_global[totalInvestigaciones].identificador_documento = totalInvestigaciones;

		/*
		*	Registro en la lista de investigaciones globales en base al Hash del documento.
		*/
		listaInvestigaciones_hash_global[param_hash_documento].nombre_Investigador = param_nombre_Investigador;
		listaInvestigaciones_hash_global[param_hash_documento].apellido1_Investigador = param_apellido1_Investigador;
		listaInvestigaciones_hash_global[param_hash_documento].apellido2_Investigador = param_apellido2_Investigador;
		listaInvestigaciones_hash_global[param_hash_documento].timestamp = param_timestamp;
		listaInvestigaciones_hash_global[param_hash_documento].hash_documento = param_hash_documento;
		listaInvestigaciones_hash_global[param_hash_documento].identificador_institucion = param_identificador_institucion;
		listaInvestigaciones_hash_global[param_hash_documento].identificador_documento = totalInvestigaciones;

             	totalInvestigaciones++;
        }


        /**
        * Esta funcion devuelve el numero total de investigaciones registradas en la blockchain
        *
        * @return _totalInvestigaciones --> el numero total de investigaciones registradas
        */
        function getNumeroTotalInvestigaciones() public view returns(uint _totalInvestigaciones) {
                _totalInvestigaciones = totalInvestigaciones;
        }


        /**
        * Esta funcion devuelve el numero total de investigaciones registradas en la blockchain en base al identificador de una institucion.
        *
        * @param param_identificador_institucion --> Identificador numerico de la institucion sobre la que realizar la consulta.
        *
        * @return _totalInvestigacionesInst --> el numero total de investigaciones registradas para dicha institucion
        */
        function getNumeroTotalInvestigacionesInstitucion(uint param_identificador_institucion) public view returns(uint _totalInvestigacionesInst) {
                _totalInvestigacionesInst = listaInstituciones_id[param_identificador_institucion].total_investigaciones_institucion;
        }


	/**
        * Esta funcin retorna, en base al identificador de la investigacion, los datos relacionados con la misma.
        *
        * @param param_idInvestigacion -> identificador del curso
        *
        * @return _nombre_Investigador --> nombre del investigador
        * @return _apellido1_Investigador --> apellido 1 del investigador
        * @return _apellido2_Investigador --> apellido 2 del investigador
        * @return _timestamp --> timestamp del cifrado del fichero
        * @return _hash_documento --> hash del fichero cifrado
        * @return _identificador_documento --> identificador de la investigacion
        *
        */
        function getInfoInvestigacionByID(uint param_idInvestigacion) public view returns(string memory _nombre_Investigador, string memory _apellido1_Investigador , string memory _apellido2_Investigador, string memory _timestamp, string memory _hash_documento, uint _identificador_institucion, uint _identificador_documento){

		require(param_idInvestigacion >= 0 && param_idInvestigacion < totalInvestigaciones,
		 "Identificador de la investigacion no registrada en la blockchain"
		 );

              	_nombre_Investigador = listaInvestigaciones_id_global[param_idInvestigacion].nombre_Investigador;
              	_apellido1_Investigador = listaInvestigaciones_id_global[param_idInvestigacion].apellido1_Investigador;
              	_apellido2_Investigador = listaInvestigaciones_id_global[param_idInvestigacion].apellido2_Investigador;
              	_timestamp = listaInvestigaciones_id_global[param_idInvestigacion].timestamp;
              	_hash_documento = listaInvestigaciones_id_global[param_idInvestigacion].hash_documento;
              	_identificador_institucion = listaInvestigaciones_id_global[param_idInvestigacion].identificador_institucion;
              	_identificador_documento = listaInvestigaciones_id_global[param_idInvestigacion].identificador_documento;

              	return (_nombre_Investigador, _apellido1_Investigador, _apellido2_Investigador, _timestamp, _hash_documento, _identificador_institucion, _identificador_documento);
        }


        /**
        * Esta funcin retorna, en base al identificador de la investigacion, los datos relacionados con la misma.
        *
        * @param param_hashDocumento -> identificador del curso
        *
        * @return _nombre_Investigador --> nombre del investigador
        * @return _apellido1_Investigador --> apellido 1 del investigador
        * @return _apellido2_Investigador --> apellido 2 del investigador
        * @return _timestamp --> timestamp del cifrado del fichero
        * @return _hash_documento --> hash del fichero cifrado
        * @return _identificador_documento --> identificador de la investigacion
        *
        */
        function getInfoInvestigacionByHash(string memory param_hashDocumento) public view returns(string memory _nombre_Investigador, string memory _apellido1_Investigador , string memory _apellido2_Investigador, string memory _timestamp, string memory _hash_documento, uint _identificador_institucion, uint _identificador_documento){

              	_nombre_Investigador = listaInvestigaciones_hash_global[param_hashDocumento].nombre_Investigador;
              	_apellido1_Investigador = listaInvestigaciones_hash_global[param_hashDocumento].apellido1_Investigador;
              	_apellido2_Investigador = listaInvestigaciones_hash_global[param_hashDocumento].apellido2_Investigador;
              	_timestamp = listaInvestigaciones_hash_global[param_hashDocumento].timestamp;
              	_hash_documento = listaInvestigaciones_hash_global[param_hashDocumento].hash_documento;
              	_identificador_institucion = listaInvestigaciones_hash_global[param_hashDocumento].identificador_institucion;
              	_identificador_documento = listaInvestigaciones_hash_global[param_hashDocumento].identificador_documento;

              	return (_nombre_Investigador, _apellido1_Investigador, _apellido2_Investigador, _timestamp, _hash_documento, _identificador_institucion, _identificador_documento);
        }


        /**
        * Esta funcin retorna, en base al identificador de la investigacion, los datos relacionados con la misma.
        *
        * @param param_identificador_institucion -> identificador de la institucion
        * @param param_identificador_investigacion -> identificador de la investigacion
        *
        * @return _nombre_Investigador --> nombre del investigador
        * @return _apellido1_Investigador --> apellido 1 del investigador
        * @return _apellido2_Investigador --> apellido 2 del investigador
        * @return _timestamp --> timestamp del cifrado del fichero
        * @return _hash_documento --> hash del fichero cifrado
        * @return _identificador_institucion --> identificador de la institucion
        * @return _identificador_documento --> identificador de la investigacion
        *
        */
        function getInfoInvestigacionByInstAndID(uint param_identificador_institucion, uint param_identificador_investigacion) public view returns(string memory _nombre_Institucion, uint _identificador_institucion, string memory _nombre_Investigador, string memory _apellido1_Investigador , string memory _apellido2_Investigador, string memory _timestamp, string memory _hash_documento, uint _identificador_documento){

		require(param_identificador_investigacion >= 0 && param_identificador_investigacion < listaInstituciones_id[param_identificador_institucion].total_investigaciones_institucion,
		 "Identificador de la investigacion no registrada en la blockchain para dicha institucion"
		 );

              	_nombre_Institucion = listaInstituciones_id[param_identificador_institucion].nombre_institucion;
              	_identificador_institucion = listaInstituciones_id[param_identificador_institucion].identificador_institucion;

              	_nombre_Investigador = listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[param_identificador_investigacion].nombre_Investigador;
              	_apellido1_Investigador = listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[param_identificador_investigacion].apellido1_Investigador;
              	_apellido2_Investigador = listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[param_identificador_investigacion].apellido2_Investigador;
              	_timestamp = listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[param_identificador_investigacion].timestamp;
              	_hash_documento = listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[param_identificador_investigacion].hash_documento;
              	_identificador_documento = listaInstituciones_id[param_identificador_institucion].listaInvestigaciones_id[param_identificador_investigacion].identificador_documento;

              	return (_nombre_Institucion, _identificador_institucion, _nombre_Investigador, _apellido1_Investigador, _apellido2_Investigador, _timestamp, _hash_documento, _identificador_documento);
        }


        /**
        * Esta funcin retorna, en base a la direccion que recibe si se trata del administrador del contrato o no.
        *
        * @param addr --> Direccion ETH a comprobar
        */
        function isAdmin(address addr) public view returns(bool resultado) {
                if(addr == administrador) {
                	resultado = true;
                } else {
                	resultado = false;
                }
        }
}

